webpackJsonp([0xf927f8900006],{793:function(e,t){e.exports={data:{page:{id:"C:/dev/Competitive/CodeButter/CodeButter/codeButter/content/pages/1--about/index.md absPath of file >>> MarkdownRemark",html:'<p>Hey! I am a Full Stack developer with an experience of building web-based - MERN stack &#x26; Android/Flutter applications.</p>\n<p>Currently working on Marg Sahayk, a grievance management tool for state Government of Gujarat.\nI also do competitive coding &#x26; take up remote/freelancing work.</p>\n<p>Take a look at <a href="bit.ly/resume-17">my resume</a>\nor <a href="/contact/">get in touch!</a></p>\n<p>Always enthusiastic about putting extra work into project to give quality results and performance.</p>\n<p>Over years have embraced UI/UX as a creative outlet &#x26; Coding as logical one.</p>\n<p>Also, loves <a href="https://www.chess.com/member/rsking17">chess</a> &#x26; cooking</p>\n<h2>Skills</h2>\n<p>Proficient with:</p>\n<p><code class="language-text">MERN Stack • Android  - CS with Android Google certificate</code></p>\n<p>Familiar with</p>\n<p> <code class="language-text">JS  •  ReactJS •  GatsbyJS • NodeJS • Django •  SQL •  Mongo • Firebase</code> </p>\n<p> Competitive Coding: </p>\n<p> <code class="language-text">C++ •  Python • Java</code> </p>\n<p> Experimenting with:  </p>\n<p> <code class="language-text">Dart  •  Flutter • P5 • Evolutionary Algorithms</code></p>\n<h2>Projects &#x26; Work Experience</h2>\n<h3>Team Leader - Marg Sahayak, Road &#x26; Building Dept., Govt of Gujarat</h3>\n<p>Apr 2018 - Present<br>\nAndroid, React, Node JS, MongoDB<br>\n<a href="http://bit.ly/marg-rnb">bit.ly/marg-rnb</a></p>\n<ul>\n<li>Currently, live on 33 districts’ state &#x26; national highways of Gujarat.</li>\n<li>Conceptualized, built, and launched a web portal which serves 1400 Officers, GIS  lookup for roads with an app to post grievances (18,000 complaints in 3 days), backed by a scalable NodeJS &#x26; MongoDB architecture.</li>\n<li>Implemented a SPA in react with offline capabilities to reduce server load and created an Android App with performance in priority.</li>\n<li>Collaborated in a team of 4, directed all product efforts, meetings with government officials, understanding project requirements &#x26; developed a complete solution deprecating slow hierarchical offline system.</li>\n<li>Created a working prototype in 2 days &#x26; was awarded as runner up among shortlisted 150 teams at Smart Gujarat Hackathon 2018.</li>\n<li>Winner at ”Synergy 2019” an IEEE project presentation contest at DA-IICT.</li>\n<li>Presented to the World Bank &#x26; exhibited at SSIP annual conference 2019</li>\n<li>Nominated for MHRD IIC’s National Exhibition in AICTE Headquarter, New Delhi.</li>\n</ul>\n<h3>Intern at MoodCafe</h3>\n<p>Dec 2018 - Jan 2019<br>\nAndroid, Node JS and MongoDB<br>\n<a href="http://moodcafe.in/android">moodcafe.in/android</a></p>\n<ul>\n<li>Moodcafe, a mental health startup incubated at CIIE: IIMA by IIT alumni.</li>\n<li>Updated Android App to version 3.0 with a major user interface redesign and features such as switching between user types. ( RxJava, Retrofit, Room, Socket.io)</li>\n<li>Contributed to rollout of  a server, successfully handling migration of all 800+ users.</li>\n</ul>',frontmatter:{title:"About Me"}},footnote:{id:"C:/dev/Competitive/CodeButter/CodeButter/codeButter/content/parts/footnote.md absPath of file >>> MarkdownRemark",html:""},site:{siteMetadata:{facebook:{appId:"1631117487039335"}}}},pathContext:{slug:"/about/"}}}});
